<script>
    let added = false
    let plotlyPlot = document.getElementsByClassName("plotly-graph-div")[0];
    const graphDiv = plotlyPlot.id
    const last_mover = document.querySelector("#last_mover").dataset.value
    window.moveBarTo = (idx) => {
        if (added) {
            Plotly.deleteTraces(graphDiv, -1)
        } else {
            added = true
        }
        Plotly.addTraces(graphDiv, {
            y: ['mover0', last_mover], x: [idx, idx], 'mode': 'lines',
            'line': {'color': 'red', 'width': 1}, name: 'Current Tick'
        });
    }
</script>
